import { Button } from "@mui/material";
import { title } from "process";
import { FC } from "react";

interface Props{
    text:string    
    backgroundColor:string,
    borderRadius:number,
    color:string,
    flex:number
}

const MyButton:FC<Props> = ({text,backgroundColor,borderRadius,color,flex}) =>{
    return (
        <Button
            sx={{
                backgroundColor: '#f6f6f6',    // Color de fondo inicial
                borderRadius:0,
                color:'#656565',
                flex:1,
                '&:hover': {
                backgroundColor: '#e0e0e0',  // Color de fondo al hacer hover
                },                
            }}
        >
            {text}
        </Button>
    );
}

export default MyButton
